„Strzał życia" to najnowszy singiel z solowej płyty Kafara z warszawskiej ekipy Dixon37. Gościnnie w utworze wyprodukowanym przez uRbana pojawił się Bonus RPK. Klip został zrealizowany przez ekipę Press Play Film w Toskanii oraz w Polsce. 

Dla opolskiego labalu solowy album Kafara Dix37 uznawany jest za jedną z najważniejszych premier w drugim półroczu 2014 roku. Na album „Panaceum” współzałożyciel składu Dixon37 zaprosił m.in. Ero z JWP/Bez Cenzury, Bezczela, Bonusa RPK, KęKę, O.S.T.R.ego, Shellera, Kaczora czy macierzysty zespół Dixon37. Oczywiście jest to tylko część zaproszonych muzyków.

Zamów album "Panaceum" tutaj: http://preorder.pl/kafar-panaceum

Kafar to warszawski raper wywodzący się z ulicznej ekipy Dixon37. Początki ursynowsko-mokotowskiej grupy datowane są na 1999 rok, wtedy też Kafar zaczął nagrywać pierwsze utwory. Po 15-latach przygody z hip-hopem muzyk zdecydował się na solowy projekt, który zatytułował „Panaceum". 

